import React from 'react'

const Login = () => {
  return (
    <div className="container">
    <h2>Login</h2>
    <input type="email" placeholder="Email" />
    <input type="password" placeholder="Password" />
    <button>Login</button>
    <p>New user? <Link to="/register">Register</Link></p>
  </div>
  )
}

export default Login
